(826, '/c.g/cg_pgmmng_crud.php', '34mujmvnvi5d7nuee4q6s8nvkt', NULL, '603afdf18d209', 'zero12a', 10, 'log_CG', 'INFO', '2', 'prepare sql : \n		select\n			0, a.PJTSEQ, c.PJTID, a.PGMSEQ, \'-\' as STATUS, a.PGMID, a.PGMNM\n			, concat(a.VIEWURL,\'^\',?,\'/d.s/\',c.PJTID,\'/\',a.VIEWURL,\'?access_token=\',?,\'^_blank\') as VIEWURL\n			, concat(\'권한받기^\',?,\'/d.s/cg_pgminfo_getauth.php?PJTSEQ=\',a.PJTSEQ,\'&PGMSEQ=\',a.PGMSEQ,\'^_blank\') as GETAUTH\n			, a.PGMTYPE\n			,b.VERDT, b.DEGREE, b.ADDDT as MAKEDT, a.ADDDT, a.MODDT\n		from \n			CG_PGMINFO a\n				left outer join CG_PGMVER b on a.PJTSEQ = b.PJTSEQ and a.PGMSEQ = b.PGMSEQ and b.ACTIVEYN=\'Y\'\n				join CGCORE.CG_PJTINFO c on a.PJTSEQ = c.PJTSEQ\n		where a.PJTSEQ = ? and (a.PGMID = ? or a.PGMNM LIKE ? or a.PGMTYPE LIKE ?)\n		order by a.PGMSEQ desc\n		', 'DEPLOYMNG', '20210228112034'),
(827, '/c.g/cg_pgmmng_crud.php', '34mujmvnvi5d7nuee4q6s8nvkt', NULL, '603afdf18d209', 'zero12a', 10, 'log_CG', 'INFO', '2', 'full sql : \n		select\n			0, a.PJTSEQ, c.PJTID, a.PGMSEQ, \'-\' as STATUS, a.PGMID, a.PGMNM\n			, concat(a.VIEWURL,\'^\',\'http://localhost:8040\',\'/d.s/\',c.PJTID,\'/\',a.VIEWURL,\'?access_token=\',\'309fc8b9991fb11fc44e615ea6df4b32812e5ef6\',\'^_blank\') as VIEWURL\n			, concat(\'권한받기^\',\'http://localhost:8040\',\'/d.s/cg_pgminfo_getauth.php?PJTSEQ=\',a.PJTSEQ,\'&PGMSEQ=\',a.PGMSEQ,\'^_blank\') as GETAUTH\n			, a.PGMTYPE\n			,b.VERDT, b.DEGREE, b.ADDDT as MAKEDT, a.ADDDT, a.MODDT\n		from \n			CG_PGMINFO a\n				left outer join CG_PGMVER b on a.PJTSEQ = b.PJTSEQ and a.PGMSEQ = b.PGMSEQ and b.ACTIVEYN=\'Y\'\n				join CGCORE.CG_PJTINFO c on a.PJTSEQ = c.PJTSEQ\n		where a.PJTSEQ = 3 and (a.PGMID = \'\' or a.PGMNM LIKE \'%%\' or a.PGMTYPE LIKE \'\')\n		order by a.PGMSEQ desc\n		', 'DEPLOYMNG', '20210228112034'),
