(1031, '/c.g/cg_pgmmng_crud.php', '34mujmvnvi5d7nuee4q6s8nvkt', NULL, '603afe0fa4c25', 'zero12a', 10, 'log_CG', 'INFO', '2', 'to_coltype before : sssisss', 'DEPLOYMNG', '20210228112105'),
