(1978, '/o.s/os2ctl.php', '3rosbg311kch4k0nrjs664cq8s', '', '603c4e301837e', NULL, NULL, 'log_CG', 'INFO', '2', 'prepare sql : \n        select\n        *\n        from\n        (\n            /* default auth */\n            select PGMID, AUTH_ID\n            from CMN_DEFAULT_AUTH\n            union\n            /* group auth */\n            select b.PGMID as PGMID, b.AUTH_ID as AUTH_ID\n            from CMN_GRP_USR a\n                join CMN_GRP_AUTH b on a.GRP_SEQ = b.GRP_SEQ\n                join CMN_MNU c on b.PGMID = c.PGMID\n            where a.USR_SEQ = ?\n            and c.PGMTYPE IN (\n                    select PGMTYPE from CMN_IP where ALLOW_IP = ? or ALLOW_IP = \'0.0.0.0\'\n                )\n            union\n            /* team auth */\n            select a2.PGMID as PGMID, a2.AUTH_ID as AUTH_ID\n            from CMN_TEAM_AUTH a2\n                join CMN_MNU b2 on a2.PGMID = b2.PGMID\n            where a2.TEAM_SEQ = \n                (\n                        select TEAM_SEQ from CMN_TEAM c2 \n                            join CMN_USR d2 on c2.TEAMCD = d2.TEAMCD and d2.USR_SEQ = ? \n                        where d2.TEAMCD is not null and d2.TEAMCD <> \'\'\n                )\n            and b2.PGMTYPE IN (\n                    select PGMTYPE from CMN_IP where ALLOW_IP = ? or ALLOW_IP = \'0.0.0.0\'\n                )\n        ) uniondata\n        order by PGMID, AUTH_ID\n        ', 'os2ctl', '20210301111513'),
(1979, '/o.s/os2ctl.php', '3rosbg311kch4k0nrjs664cq8s', '', '603c4e301837e', NULL, NULL, 'log_CG', 'INFO', '2', 'full sql : \n        select\n        *\n        from\n        (\n            /* default auth */\n            select PGMID, AUTH_ID\n            from CMN_DEFAULT_AUTH\n            union\n            /* group auth */\n            select b.PGMID as PGMID, b.AUTH_ID as AUTH_ID\n            from CMN_GRP_USR a\n                join CMN_GRP_AUTH b on a.GRP_SEQ = b.GRP_SEQ\n                join CMN_MNU c on b.PGMID = c.PGMID\n            where a.USR_SEQ = 10\n            and c.PGMTYPE IN (\n                    select PGMTYPE from CMN_IP where ALLOW_IP = \'172.17.0.1\' or ALLOW_IP = \'0.0.0.0\'\n                )\n            union\n            /* team auth */\n            select a2.PGMID as PGMID, a2.AUTH_ID as AUTH_ID\n            from CMN_TEAM_AUTH a2\n                join CMN_MNU b2 on a2.PGMID = b2.PGMID\n            where a2.TEAM_SEQ = \n                (\n                        select TEAM_SEQ from CMN_TEAM c2 \n                            join CMN_USR d2 on c2.TEAMCD = d2.TEAMCD and d2.USR_SEQ = 10 \n                        where d2.TEAMCD is not null and d2.TEAMCD <> \'\'\n                )\n            and b2.PGMTYPE IN (\n                    select PGMTYPE from CMN_IP where ALLOW_IP = \'172.17.0.1\' or ALLOW_IP = \'0.0.0.0\'\n                )\n        ) uniondata\n        order by PGMID, AUTH_ID\n        ', 'os2ctl', '20210301111513'),
