(97, 3, 4, 'selMasG', 'MAS', 8, 'R', 'RTN_SELECT_LIST', 0, 'select \n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT,MODDT\nfrom \n	CG_CODE\norder by ORD asc', 0, '20180325192036', '20200312071151'),
(98, 3, 4, 'selDtlG', 'DTL', 8, 'R', 'RTN_SELECT_LIST', 0, 'select\n	CODED_SEQ,CD,NM,CDDESC,PCD,ORD\n	,CDVAL,CDVAL2,CDMIN,CDMAX,DATATYPE\n	,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT,MODDT\nfrom CG_CODED\nwhere PCD = #{G2-PCD}\norder by ORD ', 0, '20180325192242', '20200312071151'),
