(127, 3, 65, 'sAuthNoG', 'sAuthNoG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID,count(LAUTH_SEQ) as AUTH_CNT\nFROM `CMN_LOG_AUTH` \nWHERE SUCCESS_YN = \'N\'\nGROUP BY USR_ID\nORDER BY count(LAUTH_SEQ) desc', NULL, '20180511142741', NULL),
