(640, 3, 153, 'selGrpG', '그룹목록', 12, 'R', 'RTN_SELECT_LIST', 0, 'select GRP_SEQ, GRP_NM, USE_YN, ADD_DT, MOD_DT\nfrom CMN_GRP\nwhere 1 = 1\n	and case when length(#{G1-GRP_NM}) > 0 then \n		GRP_NM like concat(\'%\',#{G1-GRP_NM},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-USE_YN}) > 0 then \n		USE_YN like concat(\'%\',#{G1-USE_YN},\'%\')\n	else 1 = 1 end \n	and case when length(#{G1-GRP_SEQ}) > 0 then \n		GRP_SEQ = #{G1-GRP_SEQ}\n	else 1 = 1 end \n', 0, '20210209053304', '20210209063533'),
(641, 3, 153, 'selHoldG', '권한보유사용자', 12, 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.GRP_SEQ, a.USR_SEQ, b.USR_ID, b.USR_NM, a.ADD_DT, a.ADD_ID, a.ADD_ID as ADD_ID2\nfrom CMN_GRP_USR a\n	join CMN_USR b on a.USR_SEQ = b.USR_SEQ\nwhere GRP_SEQ = #{G2-GRP_SEQ}\n	and case when length(#{G1-USR_ID}) > 0 then \n		USR_ID = #{G1-USR_ID}\n	else 1 = 1 end \n	and case when length(#{G1-USR_NM}) > 0 then \n		USR_NM = #{G1-USR_NM}\n	else 1 = 1 end \n', 0, '20210209053304', '20210209063751'),
(642, 3, 153, 'selNoG', '권한미보유', 12, 'R', 'RTN_SELECT_LIST', 0, 'select \n	0 as CHK, USR_SEQ, USR_ID, USR_NM\nfrom \n	CMN_USR\nwhere USR_SEQ not in (\n	select USR_SEQ\n	from CMN_GRP_USR\n	where GRP_SEQ = #{G2-GRP_SEQ}\n)\n	and case when length(#{G1-USR_ID}) > 0 then \n		USR_ID = #{G1-USR_ID}\n	else 1 = 1 end \n	and case when length(#{G1-USR_NM}) > 0 then \n		USR_NM = #{G1-USR_NM}\n	else 1 = 1 end \n', 0, '20210209053304', '20210209063808'),
(643, 3, 154, 'delHoldG', '권한 삭제', 12, 'D', 'RTN_INT', 0, 'delete from CMN_GRP_AUTH where GRP_SEQ = #{GRP_SEQ} and GA_SEQ = #{GA_SEQ}', 0, '20210209064011', '20210209064605'),
(644, 3, 154, 'insNoToHoldG', '권한 추가', 12, 'U', 'RTN_INT', 0, 'insert into CMN_GRP_AUTH (\n	GRP_SEQ, PGMID, AUTH_ID, ADD_DT, ADD_ID\n) \nselect\n	#{G2-GRP_SEQ} as  GRP_SEQ, PGMID, AUTH_ID, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom CMN_AUTH\nWHERE AUTH_SEQ = #{AUTH_SEQ}', 0, '20210209064011', '20210209064832'),
(645, 3, 154, 'selGrpG', '그룹목록', 12, 'R', 'RTN_SELECT_LIST', 0, 'select \n	GRP_SEQ, GRP_NM, USE_YN, ADD_DT, ADD_ID\nfrom CMN_GRP\nwhere 1 = 1\n	and case when length(#{G1-GRP_NM}) > 0 then\n		GRP_NM like concat(\'%\',#{G1-GRP_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210209064011', '20210209065237'),
(646, 3, 154, 'selHoldG', '보유 권한', 12, 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.GA_SEQ, a.GRP_SEQ, a.PGMID, b.MNU_NM, a.AUTH_ID, c.AUTH_NM, a.ADD_DT, a.ADD_ID\nfrom CMN_GRP_AUTH a\n	left outer join CMN_MNU b on a.PGMID = b.PGMID\n	left outer join CMN_AUTH c on a.PGMID = c.PGMID and a.AUTH_ID = c.AUTH_ID\nwhere a.GRP_SEQ = #{G2-GRP_SEQ}\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		c.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210209064011', '20210209065532'),
(647, 3, 154, 'selNoG', '미보유 권한', 12, 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.AUTH_SEQ, a.PGMID, c.MNU_NM, a.AUTH_ID, a.AUTH_NM, a.USE_YN, a.ADD_DT, a.MOD_DT		\nfrom CMN_AUTH a\n	left outer join CMN_MNU c on a.PGMID = c.PGMID\nwhere not exists(\n	select\n		*\n	from CMN_GRP_AUTH b\n	where b.GRP_SEQ = #{G2-GRP_SEQ} and a.PGMID = b.PGMID and a.AUTH_ID = b.AUTH_ID\n)\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		a.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210209064011', '20210209065414'),
(648, 3, 155, 'insGrpG', 'insGrpG', 12, 'C', 'RTN_INT', 0, 'insert into CMN_GRP\n(\n	GRP_NM, USE_YN, INTRO_PGMID, ADD_DT, ADD_ID\n) values (\n	#{GRP_NM}, #{USE_YN}, #{INTRO_PGMID}\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\'), 0\n)\n', 0, '20210209065915', '20210209070324'),
