(669, 3, 159, 'insM1', 'M1', 12, 'C', 'RTN_INT', 1, 'insert into CMN_MNU1 (\n	FOLDER_YN, FOLDER_NM, PGMID, MNU_ICON, MNU_ORD\n	, ADD_DT\n) values (\n	#{FOLDER_YN},#{FOLDER_NM},#{PGMID},#{MNU_ICON},#{MNU_ORD}\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)\n', 0, '20210210065108', '20210210065630'),
