(690, 3, 161, 'sMenuG', 'menu', 12, 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LAUTH_SEQ, REQ_TOKEN, RES_TOKEN, USR_SEQ, USR_ID\n	, PGMID, AUTH_ID, SUCCESS_YN, ADD_DT\nFROM CMN_LOG_AUTH\nWHERE USR_ID = #{USER.ID}\nORDER BY LAUTH_SEQ DESC', 0, '20210218074119', '20210218074436'),
(691, 3, 162, 'delGrpG', 'GRP', 12, 'D', 'RTN_INT', 1, 'delete from CMN_TEAM where TEAM_SEQ = #{TEAM_SEQ}\n', 0, '20210224072935', '20210224073417'),
(692, 3, 162, 'insGrpG', 'insGrpG', 12, 'C', 'RTN_INT', 0, 'insert into CMN_TEAM\n(\n	TEAMCD, TEAMNM, USE_YN, INTRO_PGMID\n	, ADD_DT, ADD_ID\n) values (\n	#{TEAMCD}, #{TEAMNM}, #{USE_YN}, #{INTRO_PGMID}\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\'), 0\n)\n', 0, '20210224072935', '20210224073334'),
(693, 3, 162, 'selGrpG', 'selGrpG', 12, 'R', 'RTN_SELECT_LIST', 10, 'select \n TEAM_SEQ, TEAMCD, TEAMNM, USE_YN, INTRO_PGMID\n , ADD_DT, ADD_ID, MOD_DT, MOD_ID\nfrom CMN_TEAM\n', 0, '20210224072935', '20210224073135'),
(694, 3, 162, 'updGrpG', 'updGrpG', 12, 'U', 'RTN_INT', 0, 'update CMN_TEAM set\n	TEAM_NM = #{TEAM_NM}, USE_YN = #{USE_YN}, INTRO_PGMID = #{INTRO_PGMID}\n	,MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), MOD_ID = 0\nwhere TEAM_SEQ = #{TEAM_SEQ}\n', 0, '20210224072936', '20210224073403'),
(695, 3, 163, 'delHoldG', '권한 삭제', 12, 'D', 'RTN_INT', 0, 'delete from CMN_TEAM_AUTH where TEAM_SEQ = #{TEAM_SEQ} and TA_SEQ = #{TA_SEQ}', 0, '20210224073027', '20210224074114'),
(696, 3, 163, 'insNoToHoldG', '권한 추가', 12, 'U', 'RTN_INT', 0, 'insert into CMN_TEAM_AUTH (\n	TEAM_SEQ, PGMID, AUTH_ID, ADD_DT, ADD_ID\n) \nselect\n	#{G2-TEAM_SEQ} as  TEAM_SEQ, PGMID, AUTH_ID, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom CMN_AUTH\nWHERE AUTH_SEQ = #{AUTH_SEQ}', 0, '20210224073027', '20210224074056'),
(697, 3, 163, 'selGrpG', '그룹목록', 12, 'R', 'RTN_SELECT_LIST', 0, 'select \n	TEAM_SEQ, TEAMCD, TEAMNM, USE_YN\n	, ADD_DT, ADD_ID\nfrom CMN_TEAM\nwhere 1 = 1\n	and case when length(#{G1-TEAMNM}) > 0 then\n		TEAMNM like concat(\'%\',#{G1-TEAMNM},\'%\')\n	else 1 = 1 end\n', 0, '20210224073027', '20210224073834'),
(698, 3, 163, 'selHoldG', '보유 권한', 12, 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.TA_SEQ, a.TEAM_SEQ, a.PGMID, b.MNU_NM, a.AUTH_ID, c.AUTH_NM, a.ADD_DT, a.ADD_ID\nfrom CMN_TEAM_AUTH a\n	left outer join CMN_MNU b on a.PGMID = b.PGMID\n	left outer join CMN_AUTH c on a.PGMID = c.PGMID and a.AUTH_ID = c.AUTH_ID\nwhere a.TEAM_SEQ = #{G2-TEAM_SEQ}\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		c.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210224073027', '20210224082123'),
(699, 3, 163, 'selNoG', '미보유 권한', 12, 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.AUTH_SEQ, a.PGMID, c.MNU_NM, a.AUTH_ID, a.AUTH_NM, a.USE_YN, a.ADD_DT, a.MOD_DT\nfrom CMN_AUTH a\n	left outer join CMN_MNU c on a.PGMID = c.PGMID\nwhere not exists(\n	select\n		*\n	from CMN_TEAM_AUTH b\n	where b.TEAM_SEQ = #{G2-TEAM_SEQ} and a.PGMID = b.PGMID and a.AUTH_ID = b.AUTH_ID\n)\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		a.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210224073027', '20210224080903'),
(700, 3, 162, 'selNo', 'TEAM', 12, 'R', 'RTN_SELECT_LIST', 10, 'select\n	\'0\' as CHK, TEAMCD, TEAMNM\nfrom CMN_USR\nwhere \nTEAMCD is not null and TEAMCD <> \'\'\nand TEAMCD not in \n	(\n	select TEAMCD from CMN_TEAM\n	)\ngroup by TEAMCD,TEAMNM', 0, '20210224075642', '20210224080654'),
(701, 3, 162, 'chkSave', 'TEAM', 12, 'U', 'RTN_INT', 1, 'insert into CMN_TEAM\n(\n	TEAMCD, TEAMNM, USE_YN, INTRO_PGMID\n	, ADD_DT, ADD_ID\n)\nselect\n	#{TEAMCD}, #{TEAMNM}, \'Y\', #{INTRO_PGMID}\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\'), 0\nfrom dual\nwhere 0 = ( select count(*) as CNT from CMN_TEAM where TEAMCD = #{TEAMCD} )\n', 0, '20210224080018', '20210224080216'),
(702, 3, 152, 'selTeam', 'TEAM', 12, 'R', 'RTN_SELECT_LIST', 1, 'SELECT \n	a.USR_SEQ, b.TEAM_SEQ, b.TEAMCD, b.TEAMNM, b.USE_YN, a.ADD_DT\nFROM \n	CMN_USR a \n	join CMN_TEAM b \n		on a.TEAMCD = b.TEAMCD\nWHERE a.USR_SEQ = #{G2-USR_SEQ}', 0, '20210225073243', '20210225073831'),
(703, 3, 164, 'delHoldG', '권한 삭제', 12, 'D', 'RTN_INT', 0, 'delete from CMN_DEFAULT_AUTH where DA_SEQ = #{DA_SEQ}', 0, '20210225080221', '20210225080924'),
(704, 3, 164, 'insNoToHoldG', '권한 추가', 12, 'U', 'RTN_INT', 0, 'insert into CMN_DEFAULT_AUTH (\n	PGMID, AUTH_ID, ADD_DT, ADD_ID\n) \nselect\n	PGMID, AUTH_ID, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom CMN_AUTH\nWHERE AUTH_SEQ = #{AUTH_SEQ}\n', 0, '20210225080221', '20210225080910'),
(706, 3, 164, 'selHoldG', '보유 권한', 12, 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.DA_SEQ, a.PGMID, b.MNU_NM, a.AUTH_ID, c.AUTH_NM, a.ADD_DT, a.ADD_ID\nfrom CMN_DEFAULT_AUTH a\n	left outer join CMN_MNU b on a.PGMID = b.PGMID\n	left outer join CMN_AUTH c on a.PGMID = c.PGMID and a.AUTH_ID = c.AUTH_ID\nwhere case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		c.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210225080221', '20210225080346'),
(707, 3, 164, 'selNoG', '미보유 권한', 12, 'R', 'RTN_SELECT_LIST', 0, 'select\n	0 as CHK, a.AUTH_SEQ, a.PGMID, c.MNU_NM, a.AUTH_ID, a.AUTH_NM, a.USE_YN, a.ADD_DT, a.MOD_DT\nfrom CMN_AUTH a\n	left outer join CMN_MNU c on a.PGMID = c.PGMID\nwhere not exists(\n	select\n		*\n	from CMN_DEFAULT_AUTH b\n	where a.PGMID = b.PGMID and a.AUTH_ID = b.AUTH_ID\n)\n	and case when length(#{G1-PGMID}) > 0 then\n		a.PGMID like concat(\'%\',#{G1-PGMID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_ID}) > 0 then\n		a.AUTH_ID like concat(\'%\',#{G1-AUTH_ID},\'%\')\n	else 1 = 1 end\n	and case when length(#{G1-AUTH_NM}) > 0 then\n		a.AUTH_NM like concat(\'%\',#{G1-AUTH_NM},\'%\')\n	else 1 = 1 end\n', 0, '20210225080221', '20210225080443');
